import React from 'react'
import "./Main.css"
import Card from './Card'

function Main(props) {

    let productData = props.proData
    // let navigate = useNavigate()
    console.log(productData, "Data came from Home")

    // function openProduct(prod) {
    //     navigate("/preview", { state: prod })
        console.log(prod, "data for prod")
    // }

    return (
        <div className="mainGridBody">
            {productData.map((prod) => (
                <>
                    <div className="clickProduct product" onClick={() => { openProduct(prod) }}>

                        <Card
                            imgSrc={prod.img}
                            title={prod.brand}
                            price={prod.face}
                        />
                    </div >
                </>
            ))
            }

        </div>
    )
}

export default Main
